using FormsCommunityToolkit.Converters;
using NUnit.Framework;
using System;
using Xamarin.Forms;

namespace Converters.Tests
{
    [TestFixture]
    public class ByteArrayToImageSourceTests
    {
        private static string Image = "";
        private ByteArrayToImageSourceConverter _converter;

        [Test]
        public void Convert_ByteArrayToImageSource_ImageSourceProduced()
        {
            byte[] bytes = ConvertToByteArray(Image);

            var imageSource = _converter.Convert(bytes, null, null, null);

            Assert.NotNull(imageSource);
            Assert.AreEqual(typeof(StreamImageSource), imageSource.GetType());
        }

        [SetUp]
        public void Setup()
        {
            _converter = new ByteArrayToImageSourceConverter();
        }

        private byte[] ConvertToByteArray(string value)
        {
            byte[] bytes = Convert.FromBase64String(value);
            return bytes;
        }
    }
}